import './App.css';
import {Route, Routes} from 'react-router-dom';
import LukeForm from './components/LukeForm';

function App() {
  return (
    <div className="App">
      <fieldset>
        <legend>App.js</legend>
        <LukeForm />
      </fieldset>
    </div>
  );
}

export default App;
